import numpy as np

class Losses:
    def __init__(self):
        pass
    
    def mae(self, org:np.array, pred:np.array) -> float:
        return np.mean(np.abs(org-pred))
    
    def mse(self, org:np.array, pred:np.array) -> float:
        return np.mean((org-pred)**2)
    
    def rmse(self, org:np.array, pred:np.array) -> float:
        return np.sqrt(np.mean((org-pred)**2))
    
    def binary_cross_entropy(self, org:np.array, pred:np.array, epsilon=0.0000001) -> float:
        # Clip pred to avoid log(0) which can lead to NaN values
        pred = np.clip(pred, epsilon, 1 - epsilon)
        return -np.mean(org*np.log(pred) + (1-org)*np.log(1-pred))
    
    def categorical_cross_entropy(self, org:np.array, pred:np.array, epsilon=0.0000001) -> float:
        # Clip pred to avoid log(0) which can lead to NaN values
        pred = np.clip(pred, epsilon, 1 - epsilon)
        return -np.sum(org * np.log(pred)) / org.shape[0]
